import React from 'react';

function LoggedInAppBar() {
  return (
    <div>
      <a href="/logout" className="linkAppBar" onClick={handleLogout}>
        LOGOUT
      </a>
    </div>
  );
}

function handleLogout() {
  localStorage.removeItem('accessToken');
}

export default LoggedInAppBar;
